import logo from './logo.svg';
import './App.css';
import Allproducts from './components/all_products';

function App() {
  return (
    <>
    <head>
    <script src="https://cdn.tailwindcss.com"></script>
    </head>
    <div className="App">
      <Allproducts/>
    </div>
    </>
  );
}

export default App;
